import './App.css';
import { Container, Row, Col, Button } from 'reactstrap';

const App = (props) => {
  return (
    <Container>
      <Row>
        <Col>
        <div className="align-items-center">
          <div className="d-flex justify-content-center">
            <Button color="secondary" className="m-4 bt">-</Button>
            <Button color="secondary" className="m-4 bt">+</Button>
          </div></div>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
